import React from 'react'


const BlogInfo = (blog) => {

    return (
        <div>
            <p>{blog.title}</p>
            <p>{blog.author}</p>
            <p>{blog.url}</p>
            <p>{blog.likes}</p>
            <p>{blog.user}</p>
        </div>
    )


}

export default BlogInfo
